    false,nt"url": null,nt"notes": "The clubbing of fur seals in Alaska and
    the killing of baby harp seals in Canada currently are generating numerous requests
    for information. This compilation of material is an attempt to answer the questions
    most frequently asked. The coverage deals primarily with the harvest or killing
    of seals. It presents arguments on both sides of the issue and attempt to clear
    up the confusion and misunderstanding that surrounds the subject. The following
    seven items - fact sheets, letters, releases, and publications - were prepared by
    the National Marine Fisheries Service in NOAA.",nt"license_title": "License
